import './index.css';

class footerLinks{
    constructor(linkName, url){
        this.linkName = linkName;
        this.url = url;
    }
}

let footerLinksArray = [];
footerLinksArray.push(new footerLinks('Google', 'https://google.com'));
footerLinksArray.push(new footerLinks('Google', 'https://google.com'));
footerLinksArray.push(new footerLinks('Google', 'https://google.com'));

const Footer = () => {
    return(
        <div className='footer-container'>
            <div className='another-links'>
                <ul>
                    {footerLinksArray.map((element, i) => {
                        if(i < footerLinksArray.length-1){
                            <>
                                return <li><a href={element.url}>{element.linkName}</a></li>
                            </>
                        }
                        else
                            return <li><a href={element.url}>{element.linkName}</a></li>
                    })}
                    {/* <li>One</li>
                    |
                    <li>One</li>
                    |
                    <li>One</li>
                    |
                    <li>One</li>
                    |
                    <li>One</li> */}
                </ul>
            </div>
        </div>
    )
}

export default Footer;
